import './App.css';
import React, { Component } from 'react'

class App extends Component {

constructor(props) {

  super(props)

  this.state = {

    board : Array(9).fill(null)

  }

}
render() {

  const Box= this.state.board.map(box => <div className="box">{box}</div>)

  return (

   <div className="container">
      <h1>TicTacToe</h1>

      <div className="board">

        {Box}

      </div>
   </div>

  );

}

}

export default App;
